<!doctype html>
<html>
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="initial-scale=1.0">
  <title>fb-project</title>
  <link rel="stylesheet" href="css/standardize.css">
  <link rel="stylesheet" href="css/fb-project.css">
</head>
<body class="body fb-project clearfix">
<a class="regpop"><img src="images/regpop.png"></a>
  <header class="fileheader clearfix">
    <div class="wrap clearfix">
      <a href="#a" class="title clearfix">
        <p class="pagetitle">Project name</p>
        <p class="projectname">Myweddingweb</p>
      </a>
      <div class="feedcomple clearfix">
      	<a href="#a" class="feedcompleted"><img src="images/complete.png"></a>
        <div class="_container clearfix">
          <p class="_text">Feedback Completion</p>
          <p class="fcount">0/10</p>
        </div>
        <div class="progressbar clearfix">
          <span class="_element"></span>
        </div>
      </div>
      <a href="#a" class="profile clearfix">
        <img class="image" src="images/profile.png">
      </a>
      <div class="profiledrop"></div>
    </div>
  </header>
  <div class="separatortop clearfix">
    <img class="image" src="images/separator project.png">
    <img class="gridlist" src="images/gridlist.png">
  </div>
  <div class="filethumbs clearfix">
    <a href="fb-file.html" class="filethumb filethumb-1">
      <div class="hovercontent clearfix">
        <div class="title title-2 clearfix">
          <p class="_text">Homepage.jpeg</p>
          <p class="qcount">2</p>
        </div>
        <img class="image image-3" src="images/l0.png">
      </div>
    </a>
    <a href="fb-file.html" class="filethumb filethumb-2">
      <div class="hovercontent clearfix">
        <div class="title title-3 clearfix">
          <p class="_text">Contact.jpeg</p>
          <p class="qcount">1</p>
        </div>
        <img class="image image-4" src="images/l0.png">
      </div>
    </a>
    <a href="fb-file.html" class="filethumb filethumb-3">
      <div class="hovercontent clearfix">
        <div class="title title-4 clearfix">
          <p class="_text">Map.jpeg</p>
          <p class="qcount">2</p>
        </div>
        <img class="image image-5" src="images/l0.png">
      </div>
    </a>
    <a href="fb-file.html" class="filethumb filethumb-4">
      <div class="hovercontent clearfix">
        <div class="title title-5 clearfix">
          <p class="_text">About us.jpeg</p>
          <p class="qcount">1</p>
        </div>
        <img class="image image-6" src="images/l0.png">
      </div>
    </a>
    <a href="fb-file.html" class="filethumb filethumb-5">
      <div class="hovercontent clearfix">
        <div class="title title-6 clearfix">
          <p class="_text">Invitation.jpeg</p>
          <p class="qcount">1</p>
        </div>
        <img class="image image-7" src="images/l0.png">
      </div>
    </a>
    <a href="fb-file.html" class="filethumb filethumb-6">
      <div class="hovercontent clearfix">
        <div class="title title-7 clearfix">
          <p class="_text">Registration.jpeg</p>
          <p class="qcount">1</p>
        </div>
        <img class="image image-8" src="images/l0.png">
      </div>
    </a>
  </div>
  <div class="separatorbottom clearfix">
    <img class="image" src="images/separator bottom.png">
  </div>
  <div class="genq clearfix">
    <img class="genq1" src="images/genq1.png">
    <img class="genq2" src="images/genq2.png">
  </div>

  <script src="js/jquery-min.js"></script>
  <script src="js/fb-project.js"></script>
</body>
</html>
